import React from "react";
// import 

const Table = ({contacts, deleteFunc}) =>
{
	console.log("cont: ", contacts.length);
	if (contacts.length !== 0){
		console.log("cont2: ", contacts.data);
	return (
		<table className="table table-striped">
			<thead>
				<tr>
				<th>Name</th>
				<th>Age</th>
				<th>Email</th>
				</tr>
			</thead>
			<tbody>
				{contacts.map((info)=>(
					<tr key={info._id}>
						<td>{info.data.name}</td>
						<td>{info.data.age}</td>
						<td>{info.data.email}</td>
						<td><button className='btn btn-primary' onClick={()=>deleteFunc(info._id)}>Delete</button></td>
					</tr>

						))}
			</tbody>
		</table>
	);
				}
				else
				return null;
};

export default Table;
